import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function LovacData() {
    const navigate = useNavigate();
    const [lovci, setLovci] = useState([]);

    useEffect(() => {
        axios.get('/lovac/1')
            .then(response => {
                if (response.data.error) {
                    alert(response.data.message);
                } else {
                    setLovci([response.data.data]);
                }
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }, []);

    const buttonStyle = {
        padding: '10px 20px',
        fontSize: '16px',
        color: 'white',
        backgroundColor: '#007BFF',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer'
    };

    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', height: '100vh', backgroundColor: '#eee' }}>
            <button onClick={handleButtonClick} style={buttonStyle}>
                Unesi lovca
            </button>
            <table style={{ marginTop: '20px', borderCollapse: 'collapse', width: '80%' }}>
                <thead>
                    <tr>
                        <th>Broj lovačke iskaznice</th>
                        <th>Ime</th>
                        <th>Prezime</th>
                        <th>Adresa</th>
                        <th>Datum rođenja</th>
                        <th>Kontakt</th>
                        <th>Korisničko ime</th>
                        <th>Lozinka</th>  {/* Consider masking or not displaying sensitive data */}
                    </tr>
                </thead>
                <tbody>
                    {lovci.map(lovac => (
                        <tr key={lovac.korisnicko_ime}>
                            <td>{lovac.broj_lovacke_iskaznice}</td>
                            <td>{lovac.ime}</td>
                            <td>{lovac.prezime}</td>
                            <td>{lovac.adresa}</td>
                            <td>{lovac.datum_rodjenja}</td>
                            <td>{lovac.kontakt}</td>
                            <td>{lovac.korisnicko_ime}</td>
                            <td>{lovac.lozinka}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default LovacData;
